export enum AppRoute {
    Main = '/catalog',
    Page1 = '/catalog/page_1',
    Page2 = '/catalog/page_2',
    Page3 = '/catalog/page_3',
}

export enum APIRoute {
    Guitars = '/guitars',
}

export enum NameSpace {
    data = 'DATA',
    guitar = 'GUITAR',
}

export const GUITAR_CARDS_COUNT = 9;
export const GUITAR_CARDS_COUNT_STEP = 9;
